script: |
  super -f text -I q8627.spq | sort > q8627.out

inputs:
  - name: q8627.spq
    data: |
      SELECT - 90 AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE col0 - + col2 + + + 61 <> - ( - col2 ) + col2;
  - name: tab2

outputs:
  - name: q8627.out
    data: |
      -90
      -90
      -90
